  \"\",\n\t\t\"description\": \"This file contains a file geodatabase of the Mount
  St. Helens seismic zone (MSHSZ) geothermal play-fairway site in the Washington Cascades.
  The geodatabase includes input data (feature classes) and output rasters (generated
  from modeling and interpolation) from the geothermal play-fairway in Washington
  State, USA. These data were gathered and modeled to provide an estimate of the heat
  and permeability potential within the play-fairways based on: mapped volcanic vents,
  hot springs and fumaroles, geothermometry, intrusive rocks, temperature-gradient
  wells, slip tendency, dilation tendency, displacement, displacement gradient, max
  coulomb shear stress, sigma 3, maximum shear strain rate, and dilational strain
  rate at 200m and 3 km depth. In addition this file contains layer files for each
  of the output rasters. For details on the areas of interest please see the 'WA_State_Play_Fairway_Phase_1_Technical_Report'
  in the download package. All data are in NAD_1983_HARN_StatePlane_Washington_South_FIPS_4602_Feet.\",\n\t\t\"format\":
